import BubbleBox from "../Presenter/BubbleBox";
import { Name, Date, Content } from "../Presenter/Inbubble";

const OpponentBubbleContainer = () => {

    return (
        <BubbleBox>
            <Name>김수환</Name>
            <Date>1:40 PM</Date>
            <Content>반가워요 여러분~!</Content>
        </BubbleBox>
    )
}

export default OpponentBubbleContainer;
